#include "libc/macros.h"

deflateInit:
	mov	$Z_DEFLATED,%edx
	mov	$MAX_WBITS,%ecx
	mov	$DEF_MEM_LEVEL,%r8d
	mov	$Z_DEFAULT_STRATEGY,%r9d
	jmp	deflateInit2
	.endfn	deflateInit,globl
